import mongoose, { Schema, model } from 'mongoose'
const Joi = require('@hapi/joi')
const estationSchema = new Schema({

    Temperatura: String,
    Humedad: String,
    Velocidad_Viento: Joi.number() ,
    Dir_Viento:  Joi.number() ,
    Lluvia: Joi.number() 
});

export default model("Estacion", estationSchema);

